7.bio:
My career has roots in finance and financial systems and I have been working with or using business intelligence tools and data for more than 20 years. During this time I have worn many hats; consultant, channel sales, product management, development, and most relevant end-user. As one of the co-inventors of many products including Smart View, Smart Space, Synopsis, and Day by Day I am passionate about how analytics can truly be delivered to the end users regardless of channel.

I am known for delivery and specialize in delivering products and invigorating teams for key product areas that need focus or have become critical to the core business.  My specialties are software design and development, product definition and direction, customer escalations, proof of concepts, rapid prototype development, and product evangelist.

@mmilella

